document.addEventListener("contextmenu", function(e) {
    e.preventDefault();
});

document.addEventListener("keydown", function(e) {
    // Autoriser Ctrl+A (sélection de tout le texte)
    if (e.ctrlKey && e.key === "a") {
        return; // Autoriser l'événement par défaut pour Ctrl+A
    }
    // Autoriser Ctrl+C (copier) et Ctrl+V (coller)
    if (e.ctrlKey && (e.key === "c" || e.key === "v")) {
        return; // Autoriser l'événement par défaut pour Ctrl+C et Ctrl+V
    }
    // Autoriser le retour à la ligne avec Enter (retour chariot)
    if (e.key === "Enter") {
        return; // Autoriser l'événement par défaut pour Enter
    }
    // Autoriser la suppression avec Backspace et Delete
    if (e.key === "Backspace" || e.key === "Delete") {
        return; // Autoriser l'événement par défaut pour Backspace et Delete
    }
    // Autoriser le rafraîchissement de la page avec Ctrl+R
    if (e.ctrlKey && e.key === "r") {
        return; // Autoriser l'événement par défaut pour Ctrl+R
    }
    // Autoriser l'écriture de texte (toutes les autres touches)
    if (!e.ctrlKey && !e.altKey && !e.metaKey) {
        return; // Autoriser l'événement par défaut pour l'écriture de texte
    }
    // Bloquer tous les autres événements de clavier
    e.preventDefault();
});




